    public static int singleNumber(int[] nums) {
        Arrays.sort(nums);
        int i = 0;
        int j = 1;
        while (j < nums.length) {
            if (nums[i] != nums[j]) {
                return nums[i];
            }
            i = j + 2;
            j = j + 2;
        }
        return 0;
    }

    public static int[] intersect(int[] nums1, int[] nums2) {
        Arrays.sort(nums1);
        Arrays.sort(nums2);
        int len1 = nums1.length;
        int len2 = nums2.length;
        //int minLen = len1 < len2? len1:len2;
        //int [] arr = new int[minLen];
        List<Integer> arr = new ArrayList();
        int i = 0;
        int j = 0;
        int k = 0;
        while (i < len1 && j < len2) {
            if (nums1[i] == nums2[j]) {
                //  arr[k++] = nums1[i];
                arr.add(nums1[i]);
                i++;
                j++;
            } else if (nums1[i] < nums2[j]) {
                i++;
            } else {
                j++;
            }
        }
        int[] result = new int[arr.size()];
        for (int ii = 0; ii < arr.size(); ii++) {
            result[ii] = arr.get(i);
        }
        return result;
    }

    public static void moveZeroes(int[] nums) {
        int i = 0, j = 1;
        while (j < nums.length) {
            if (nums[i] == 0 & nums[j] != 0) {
                nums[i] ^= nums[j];
                nums[j] ^= nums[i];
                nums[i] ^= nums[j];
                i++;
            } else if (nums[i] != 0) {
                i++;
            }
            j++;
        }
    }

    public static void moveZeroes1(int[] nums) {
        int i = 0;
        for (int j = 0; j < nums.length; j++) {
            //只要不为0就往前挪
            if (nums[j] != 0) {
                //i指向的值和j指向的值交换
                int temp = nums[i];
                nums[i] = nums[j];
                nums[j] = temp;

                i++;
            }
        }

    }

    public static int[] twoSum(int[] nums, int target) {
        int[] answer = new int[2];
        Map<Integer, Integer> map = new HashMap();
        int i = 0;
        int i2 = 0;
        for (; i < nums.length; i++) {
            Integer mate = map.get(target - nums[i]);
            if (mate != null) {
                i2 = mate;
                break;
            }
            map.put(nums[i], i);
        }

        answer[0] = i;
        answer[1] = i2;
        return answer;
    }

    /**
     * 有效的数独
     * 1.同一个数字在每一行只能出现一次；
     * 2.同一个数字在每一列只能出现一次；
     * 3.同一个数字在每一个小九宫格只能出现一次。
     */
    public static boolean isValidSudoku() {
//        char[][] board = {{'5', '3', '.', '.', '7', '.', '.', '.', '.'}
//                , {'6', '.', '.', '1', '9', '5', '.', '.', '.'}
//                , {'.', '9', '8', '.', '.', '.', '.', '6', '.'}
//                , {'8', '.', '.', '.', '6', '.', '.', '.', '3'}
//                , {'4', '.', '.', '8', '.', '3', '.', '.', '1'}
//                , {'7', '.', '.', '.', '2', '.', '.', '.', '6'}
//                , {'.', '6', '.', '.', '.', '.', '2', '8', '.'}
//                , {'.', '.', '.', '4', '1', '9', '.', '.', '5'}
//                , {'.', '.', '.', '.', '8', '.', '.', '7', '9'}};
        char[][] board = {{'.', '.', '.', '.', '5', '.', '.', '1', '.'},
                {'.', '4', '.', '3', '.', '.', '.', '.', '.'},
                {'.', '.', '.', '.', '.', '3', '.', '.', '1'},
                {'8', '.', '.', '.', '.', '.', '.', '2', '.'},
                {'.', '.', '2', '.', '7', '.', '.', '.', '.'},
                {'.', '1', '5', '.', '.', '.', '.', '.', '.'},
                {'.', '.', '.', '.', '.', '2', '.', '.', '.'},
                {'.', '2', '.', '9', '.', '.', '.', '.', '.'},
                {'.', '.', '4', '.', '.', '.', '.', '.', '.'}};
        // 数独中每一行每一个数字出现的次数
        int[][] rows = new int[9][9];
        // 数度中每一列每一个数字出现的次数
        int[][] columns = new int[9][9];
        // 数度中每一个小九宫格内每一个数字出现的次数
        int[][][] subboxes = new int[3][3][9];
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board.length; j++) {
                if (board[i][j] != '.') {
                    // board[i][i1]的范围是[1,9],避免rows、columns、subboxes下标越界，所以index 的范围[0-8]，
                    int index = board[i][j] - '0' - 1;
                    // 第n行的index上++
                    rows[i][index]++;
                    // 第i1列的index上++
                    columns[j][index]++;
                    subboxes[i / 3][j / 3][index]++;
                    // 如果计数大于1，说明行或列或小九宫格内有重复的数字
                    if (rows[i][index] > 1 || columns[j][index] > 1 || subboxes[i / 3][j / 3][index] > 1) {
                        return false;
                    }
                }
            }
        }
        return true;
    }

    public static boolean isValidSudoku2() {
        char[][] board = {{'.', '.', '.', '.', '5', '.', '.', '1', '.'},
                {'.', '4', '.', '3', '.', '.', '.', '.', '.'},
                {'.', '.', '.', '.', '.', '3', '.', '.', '1'},
                {'8', '.', '.', '.', '.', '.', '.', '2', '.'},
                {'.', '.', '2', '.', '7', '.', '.', '.', '.'},
                {'.', '1', '5', '.', '.', '.', '.', '.', '.'},
                {'.', '.', '.', '.', '.', '2', '.', '.', '.'},
                {'.', '2', '.', '9', '.', '.', '.', '.', '.'},
                {'.', '.', '4', '.', '.', '.', '.', '.', '.'}};
        int[] row = new int[10], col = new int[10], area = new int[10];
        for (int i = 0; i < 9; i++) {
            for (int j = 0; j < 9; j++) {
                char c = board[i][j];
                if (c == '.') continue;
                int u = c - '0';
                int idx = i / 3 * 3 + j / 3;
                if ((((row[i] >> u) & 1) == 1) || (((col[j] >> u) & 1) == 1) || (((area[idx] >> u) & 1) == 1))
                    return false;
                row[i] |= (1 << u);
                col[j] |= (1 << u);
                area[idx] |= (1 << u);
            }
        }
        return true;
    }

    /**
     * 旋转图像
     *
     * @param matrix
     */
    @Test
    public void rotate() {
        int[][] matrix = {{5, 1, 9, 11, 0}, {2, 4, 8, 10, 0}, {9, 3, 6, 7, 0}, {13, 3, 6, 7, 0}, {15, 14, 12, 16, 0}};
        int eagelen = matrix[0].length;
        for (int i = 0; i < matrix.length / 2; i++) {
            int[] temp = matrix[i];
            matrix[i] = matrix[eagelen - i - 1];
            matrix[eagelen - i - 1] = temp;
        }
        for (int i = 0; i < eagelen; i++) {
            for (int j = i + 1; j < eagelen; j++) {
                if (i != j) {
                    int k = matrix[i][j];
                    matrix[i][j] = matrix[j][i];
                    matrix[j][i] = k;
                }
            }
        }
    }

    /**
     * 旋转图像2 原地旋转
     */
    @Test
    public void rotate2() {
        int[][] matrix = {{5, 1, 9, 11, 0}, {2, 4, 8, 10, 0}, {9, 3, 6, 7, 0}, {13, 3, 6, 7, 0}, {15, 14, 12, 16, 0}};
        int len = matrix.length;
        // i=0时处理的是最外圈的矩形，i=1、2、3、n。。一圈一圈向内循环处理
        for (int i = 0; i < len / 2; i++) {
            // j的初始值是i，矩形的左上角开始处理
            // len-1-i 是矩形的最后边元素索引

            for (int j = i; j < len - 1 - i; j++) {
                // 矩形上边的元素赋给临时变量
                int temp = matrix[i][j];
                // 矩形左边的元素赋给矩形上边
                matrix[i][j] = matrix[len - 1 - j][i];
                // 矩形下边的元素赋给矩形左边
                matrix[len - 1 - j][i] = matrix[len - 1 - i][len - 1 - j];
                // 矩形右边的元素赋给矩形下边
                matrix[len - 1 - i][len - 1 - j] = matrix[j][len - 1 - i];
                // 临时变量赋给矩形右边
                matrix[j][len - 1 - i] = temp;
            }
        }
    }

    /**
     * 旋转图像3 对角线翻转+左右翻转
     */
    @Test
    public void rotate3() {
        int[][] matrix = {{5, 1, 9, 11, 0}, {2, 4, 8, 10, 0}, {9, 3, 6, 7, 0}, {13, 3, 6, 7, 0}, {15, 14, 12, 16, 0}};
        int len = matrix.length;
        for (int i = 0; i < len; i++) {
            for (int j = 0; j < i; j++) {
                matrix[i][j] ^= matrix[j][i];
                matrix[j][i] ^= matrix[i][j];
                matrix[i][j] ^= matrix[j][i];
            }
        }
        for (int i = 0; i < len; i++) {
            for (int j = 0; j < len / 2; j++) {
                matrix[i][j] ^= matrix[i][len - j - 1];
                matrix[i][len - j - 1] ^= matrix[i][j];
                matrix[i][j] ^= matrix[i][len - j - 1];
            }
        }
    }

